{% extends \"@MyTechnosBlog/Front/layout.html.twig\" %}


{% block main %}

<!-- Extension du layout au templates fils -->

  <main>

    <section class=\"containerRegistrationForm\">


      <h1>Inscription</h1>

        {{ form_start(form) }}
          {{ form_row(form.pseudo) }}
          {{ form_row(form.username) }}
