          {{ form_row(form.password.second) }}
          <input type=\"submit\" value=\"Je m'inscrit\">
        {{ form_end(form) }}

      <p>Vous êtes déja inscrit ? <a href=\"\">Cliquez ici</a> pour vous connecter !</p>

    </section>


  </main>



{% endblock %}



